def get_score(context, acc, auc, f1_score, recall, cost_time):
    
    for line in context.split('\n'):
        if line:
            line = line.split(',')
            acc.append(float(line[4].split(':')[1]))
            auc.append(float(line[5].split(':')[1]))
            f1_score.append(float(line[6].split(':')[1]))
            recall.append(float((line[7].split(':')[1]).strip().removesuffix('}')))
            cost_time.append(float(line[1].split(':')[1]))

def convert_time(time):
    h = time // 3600
    m = (time - h * 3600) // 60
    m = round(m)
    s = time - h * 3600 - m * 60
    s = round(s)
    return f'{h}h {m}m {s}s'


